import React, {Component} from 'react';
import Task from "../task/task";
import TaskToggle from "../task-toogle/task-toggle";

export default class TaskListItem extends Component {




    render() {

        const  {className, id, mainFunction} = this.props;
        if(className === 'editing'){
            return ( <li className={className}>
                    <Task {...this.props}/>
                    <TaskToggle type="text" className="edit" value="Editing task"/>
                </li>
            )
        } else {
            return (
                <li className={className}>   <Task {...this.props}/> </li>
            )


        }



}
}








